const AddNewCategory = (userId,token,cateogry) => {
    return(
        fetch(`http://192.168.1.7:8000/api/category/creat/${userId}`, {
        method: 'POST',
        headers:
        { 'Content-Type': 'application/json',
            Authorization : `Bearer ${token}`
        },
        body: JSON.stringify(cateogry)
    })
    .then(Response => {
        return Response.json();
    })
    .catch(error => {
        return error;
    })
    );
} 
const AddNewProduct = (userId,token,product) => {
    return(
        fetch(`http://192.168.1.7:8000/api/product/creat/${userId}`, {
        method: 'POST',
        headers:
        { 
            Authorization : `Bearer ${token}`
        },
        body: product
    })
    .then(Response => {
        return Response.json();
    })
    .catch(error => {
        return error;
    })
    );
} 
export {AddNewCategory} ;
export {AddNewProduct} ;
